// import logo from './img/1.jpg';
import Navbar from './Halpper/navabar';
import './App.css';
import logo from './img/logo.jpg'
import Imgeshow from './Halpper/imgshow'
import ImgeShow from './Halpper/imgshow';
import imgdic from './Data/Imgedata'

function App() {
  return (
    <>
    <header>
      <img className="logo" src={logo}></img>
      <span className="logo-text">
        <span id="ht">Z</span>
        <span id="ht">e</span>
        <span id="ht">e</span>
        <span id="ht">L</span>
        <span id="ht"> P</span>
        <span id="ht">r</span>
        <span id="ht">a</span>
        <span id="ht">J</span>
        <span id="ht">a</span>
        <span id="ht">p</span>
        <span id="ht">a</span>
        <span id="ht">t</span>
        <span id="ht">i's</span>
        Prajapati's Personal Web site
      </span>
    </header>
    <Navbar />
      <ImgeShow imgdic={imgdic}></ImgeShow>
    </>
  );
}

export default App;
